post_text:
Dear Centennial Community;

Please click here to view a video message from the Superintendent of Schools.

https://youtu.be/1WFWgo4doQ8

Dear Centennial Community;

Do you or someone you know need some extra income? The Centennial School District is currently looking for substitute teachers, substitute instructional assistants, and substitute cafeteria monitors (non-instructional assistants) through our partnership with ESS (formerly Source4Teachers). If you are interested in serving in one or more of these roles, please apply here.

The District is also looking for additional substitute bus drivers and food service workers. If you are interested in any of these positions, please apply directly through the Employment section of the district website. www.centennialsd.org

