post_text:
Dear Centennial Community;
Did you know that Sudden Cardiac Arrest is the #1 cause of death of student athletes? It takes the lives of thousands of students every year.

Centennial School District in partnership with Simon's Heart is pleased to host a FREE Youth Heart Screening for students ages 12-19. This screening will be held on Saturday, October 19, 2019 from 9:00 a.m. - 2:00 p.m. at William Tennent High School. Registration is required. For additional information, please see the attached flyer. https://simonsheart.org/blog/event/centennial-heart-screening/

